import axios from "axios";

export const BACKEND_POINT = 'https://qtify-backend-labs.crio.do'


export const featchTopAlbum = async () => {
  try {
    const res = await axios.get(`${BACKEND_POINT}/album/top`);
    return res.data;
    console.log()
  } catch(e) {
    console.error(e)
  }
}
